import React from 'react';
import {Card,CardDeck} from 'react-bootstrap';
import donations from './donations.jpg';
import doctors from './doctors.jpg';
import patients from './patients.jpg';
import './style.scss';

const Data =() =>{

  return(

    <CardDeck className="deck">
  <Card className="dim shadow-5-l">
  <Card.Img className="img" variant="top" src={donations} />
    <Card.Body>
      <h3 style={{marginTop:"5px"}}>Donations</h3>
      <h4>$10000</h4>
    </Card.Body>
  </Card>
  <Card className="dim">
  <Card.Img className="img" variant="top" src={doctors} />
    <Card.Body>
    <h3 style={{marginTop:"5px"}}>Doctors and Health Care Workers</h3>
      <h4>1500</h4>
    </Card.Body>
  </Card>
  <Card className="dim">
  <Card.Img className="img" variant="top" src={patients} />
    <Card.Body>
    <h3 style={{marginTop:"5px"}}>Patients</h3>
      <h4>2000</h4>
    </Card.Body>
  </Card>
</CardDeck>
  );

}

export default Data;
